    {
      "cell_type": "markdown",
      "metadata": {
        "id": "5Qx0roGwar3C"
      },
      "source": [
        "**Même après avoir attribué des poids égaux à chacune des classes, le modèle de classification d'arbre de décision serait en mesure de prédire avec précision que seulement 9 % du nombre total des entreprises ont fait faillite, maintenant essayons d'améliorez-le modele avec le réglage des hyperparamètres du modèle.**"
      ]
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "ZeF2OkJHbEXz"
      },
      "source": [
        "**3-Réglage des Hyperparametres(Hyperparamters Tuning)**"
      ]
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "5WSN3j07bK3S"
      },
      "source": [
        "**La précision du modèle est très élevée mais son rappel reste très faible,a partir du surajustement, mais cela peut être contrôlé en fixant certains paramètres de l'alogrithim**"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 99,
      "metadata": {
        "id": "aSNUCelRN4pZ"
      },
      "outputs": [],
      "source": [
        "def f1_test_params(**params):\n",
        "    model = DecisionTreeClassifier(random_state=30, class_weight= 'balanced',**params).fit(x_train,train_targets)\n",
        "    train_f1_test = f1_score(train_targets,model.predict(x_train))\n",
        "    val_f1_test = f1_score(val_targets,model.predict(x_val))\n",
        "    return train_f1_test, val_f1_test"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 100,
      "metadata": {
        "id": "pugTGS42QPJl"
      },
      "outputs": [],
      "source": [
        "def f1_test_param_and_plot(param_name, param_values):\n",
        "    train_errors, val_errors = [], [] \n",
        "    for value in param_values:\n",
        "        params = {param_name: value}\n",
        "        train_f1_test, val_f1_test = f1_test_params(**params)\n",
        "        train_errors.append(train_f1_test)\n",
        "        val_errors.append(val_f1_test)\n",
        "    plt.figure(figsize=(10,6))\n",
        "    plt.title('Courbe de surajustement : ' + param_name)\n",
        "    plt.plot(param_values, train_errors, 'b-o')\n",
        "    plt.plot(param_values, val_errors, 'r-o')\n",
        "    plt.xlabel(param_name)\n",
        "    plt.ylabel('F1 Score')\n",
        "    plt.legend([\"Données d'entrainements\", 'Données de Validation'])"
      ]
    },
