    {
      "cell_type": "markdown",
      "source": [
        "**Même après avoir donné les poids équilibrés aux classes '0' et '1', le modèle n'as pas de résultats satisfaisants, il est donc nécessaire de régler les hyperparamètres pour réduire le surajustement**"
      ],
      "metadata": {
        "id": "J0nCE5oFm2WD"
      }
    },
    {
      "cell_type": "code",
      "execution_count": 176,
      "metadata": {
        "id": "wjxDwXr_iMTT"
      },
      "outputs": [],
      "source": [
        "#fonction de définition pour calculer le score f1 sur les données d'entraînement et de validation\n",
        "def f1_test_params_rfc(**params):\n",
        "    model = RandomForestClassifier(random_state=30, class_weight= 'balanced',**params).fit(x_train,train_targets)\n",
        "    train_f1_test = f1_score(train_targets,model.predict(x_train))\n",
        "    val_f1_test = f1_score(val_targets,model.predict(x_val))\n",
        "    return train_f1_test, val_f1_test"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 177,
      "metadata": {
        "id": "KiVq3Fw-i1Ul"
      },
      "outputs": [],
      "source": [
        "def f1_test_param_and_plot_rfc(param_name, param_values):\n",
        "    train_errors, val_errors = [], [] \n",
        "    for value in param_values:\n",
        "        params = {param_name: value}\n",
        "        train_f1_test, val_f1_test = f1_test_params_rfc(**params)\n",
        "        train_errors.append(train_f1_test)\n",
        "        val_errors.append(val_f1_test)\n",
        "    plt.figure(figsize=(10,6))\n",
        "    plt.title('Courbe de surajustement: ' + param_name)\n",
        "    plt.plot(param_values, train_errors, 'b-o')\n",
        "    plt.plot(param_values, val_errors, 'r-o')\n",
        "    plt.xlabel(param_name)\n",
        "    plt.ylabel('F1 Score')\n",
        "    plt.legend([\"Données d'entrainements\", 'Données de Validation'])"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 181,
      "metadata": {
        "id": "mraxOtuYj5Kh"
      },
      "outputs": [],
      "source": [
        "def recall_test_params_rfc(**params):\n",
        "    model = RandomForestClassifier(random_state=30, class_weight='balanced', **params).fit(x_train,train_targets)\n",
        "    train_recall = recall_score(train_targets,model.predict(x_train))\n",
        "    val_recall = recall_score(val_targets,model.predict(x_val))\n",
        "    return train_recall, val_recall"
      ]
    },
