        "Avec les données ci-dessus, les trois modèles ont prédit que les entreprises ne fonctionne pas bien mais la probabilité qu'il y ait faillite est faible, le modèle de forêt aléatoire est sûr à 55 % que le l'entreprise ne fera pas faillite alors que l'arbre de décision semble très confiant (90 %) que\n",
        "l'entreprise ne fera face à aucun cas de faillite. "
